import React from 'react'
import { TextField } from '@material-ui/core'

class VinList extends React.Component {
    handleVinChange() {
        console.log(e.target.value)

    }
    render() {
        return (
            <>
                <TextField 
                    id='vin'
                    label='vin'
                    onChange={this.handleVinChange}
                />
            </>
        )
    }

}

export default VinList
